CREATE DEFINER=`root`@`localhost` FUNCTION `compute_nearest_level`(
var_lower_level float,
var_upper_level float,
var_price_level float) RETURNS int(11)
BEGIN


if(var_upper_level -  var_price_level) > (var_price_level - var_lower_level) then

return 1;

else

return 2;

end if;

END ;;
