CREATE DEFINER=`root`@`localhost` FUNCTION `round_float_price`(
var_input_price float) RETURNS float(10,2)
BEGIN

declare var_residue float;

set var_residue = mod(var_input_price, 0.05);

if( var_residue <= 0.025)
then

return (var_input_price -  var_residue);

else

return    (var_input_price -  var_residue) + 0.05;

end if;

END ;;
