CREATE DEFINER=`root`@`localhost` PROCEDURE `calculate_mode_levels`(
out var_price_mode int)
label_proc : BEGIN

declare var_max_count_mode int;

declare var_count_max_count_mode int;

DELETE FROM price_mode_data;


replace into price_mode_data(
SELECT price, COUNT(price) FROM live_data_staging_mode_calculation
GROUP BY price
ORDER BY COUNT(price) DESC);


select max(count_price) from  price_mode_data
into var_max_count_mode;

if(var_max_count_mode < 3)
then
leave label_proc;
end if;

select count(*) from  price_mode_data
where  count_price = var_max_count_mode
into  var_count_max_count_mode;

if(var_count_max_count_mode = 1)
then

select price from  price_mode_data
where count_price =  var_max_count_mode
into var_price_mode;

else

call compute_price_mode(var_max_count_mode,var_price_mode);

end if;




END ;;
