CREATE DEFINER=`root`@`localhost` PROCEDURE `compute_price_mode`(
var_max_count_mode int,
out var_price_mode float)
BEGIN

declare avg_price float;

declare counter int;

declare user_cnt int;

delete from price_mode_data
where count_price !=   var_max_count_mode;


select avg(price)
from price_mode_data
into avg_price;

delete from  price_mode_data
where abs(price - avg_price) > (avg_price * 0.5/100);

select avg(price)
from price_mode_data
into var_price_mode;

set var_price_mode = round_float_price(var_price_mode);


END ;;
